import "./Item.css";
function Item() {
  const itemDate = new Date().toLocaleString();
  const itemTitle = "Car insurance";
  const itemAmount = 80;
  return (
    <div className="item">
      <div>{itemDate}</div>
      <div className="item__description">
        <h2>{itemTitle}</h2>
        <div className="item__price">${itemAmount}</div>
      </div>
    </div>
  );
}

export default Item;
